import React from 'react';
const Trigger = ({ triggerText, buttonRef, showModal, classButton, formId }) => {


  if (typeof formId !== 'undefined'){
    return (
      <button
        className={classButton}
        ref={buttonRef}
        onClick={showModal}
      >
        {triggerText}
      </button>
    );
  }
  else{
    return (
      <button
        className={classButton}
        ref={buttonRef}
      >
        {triggerText}
      </button>
    );
  }
};
export default Trigger;
